import React, {useState} from 'react'
import styled from 'styled-components'
import Head from '../components/head'
import Layout from '../components/layout'
import Navbar from '../components/nav/navBar'
import NavHomeMobile from '../components/nav/navHomeMobile'
import { Carousel } from 'react-bootstrap'
import NewItem from '../components/Card/newItemCard'
// import Gallery from '../components/Card/gallery'
import '../style/index.css'
import 'bootstrap/dist/css/bootstrap.min.css';

const Container = styled.div`
	width: 80%;
  margin: 0 auto;
	padding: 150px 0 50px 0;
`
const Main = styled.div`
  width: 60%;
  @media (max-width: 768px){
    width: 100%;
  }
`
const Title = styled.div`
  width: 100%;
  justify-content: space-between;
  display: flex;
  position:relative;
  vertical-align:text-bottom;
  & > h1{
    color: #000;
    font-size: 28px;
  }
  & > div{
    padding-top: 15px;
    color: #969696;
    font-size: 14px;
    margin-left: -250px;
  }
  & > h2{
    color: #00AAF5;
    font-size: 28px;
  }
  @media (max-width: 768px){
    & > h1{
      color: #000;
      font-size: 22px;
    }
  }
`
const MbTitle = styled.h1`
  color: #00AAF5;
  font-size: 22px;
  display: none;
  margin-top: 10px;
  @media (max-width: 768px){
    display: block;
  }
`
const SubTitle = styled.div`
  width: 100%;
`
const Specification = styled.div`
  width: 60%;
  justify-content: space-between;
  display: flex;
  margin-top: 22px;
  margin-bottom: 10px;
  @media (max-width: 768px){
    width: 100%;
    display: none;
  }
`
const SpecificationMb = styled.div`
  width: 100%;
  display: none;
  margin-top: 22px;
  margin-bottom: 10px;
  justify-content: space-between;
  @media (max-width: 768px){
    display: block;
  }
`
const Cau = styled.div`
  width: 95%;
  @media (max-width: 768px){
    width: 100%;
  }
`
const BigTitle = styled.div`
  text-align: center;
  // padding: 60px 0;
  padding: 60px 0 40px 0;
  @media (max-width: 768px){
    padding: 20px 0 40px 0;
    padding-bottom: 20px;
  }
`
const TitleImg = styled.img`
  width:112px;
  @media (max-width: 768px){
    width:112px;
  }
`
const ItemContent = styled.div`
  width: 60%;
  @media (max-width: 768px){
    width: 100%;
  }
`
const Introduction = styled.div`
  width: 100%;
`
const IntroTitle = styled.div`
  /* width: 100%; */
  color: #00B1FF;
  font-size: 20px;
`
const IndList = styled.div`
  border-top: 1px solid #F0F0F0;
  border-bottom: 1px solid #F0F0F0;
  display: flex;
  padding: 5px 0;
`
const IndTag = styled.div`
